import "./App.css";
import Map from "./Map";
import placeholder from "./place-holder.jpg";

function App() {
  return (
    <div className="container">
      <div className="image-placeholder">
        <image src="place-holder.jpg" alt="placeholder" />
      </div>
      <div className="map-container">
        <Map />
      </div>
    </div>
  );
}

export default App;
